@Tsuna / Supremazi57 It's true though. You won't learn anything using this tool.

And it doesn't show you best practices through experience.

It's a decent tool for actual developers, but for people learning I'm skeptical

@Hunter there used to be a time before the industrial revolution where the majority of the population were part of the agriculture industry. Now it's just a fraction of the population.
Getting in the way of automation isn't going to work in the long run, because whatever country implements it first will have a huge advantage.
Even though some people foam at the idea, but at some point universal income will be necessary.
